import React from 'react';
import "./style.scss";
import { HashLink } from 'react-router-hash-link';

export default function Footer(){
    return (<nav className="nav-top" >
        
            <div className="nav-item">
            <HashLink smooth to='#home' className="nav-link"><span className="nav-label" id="nav-label">Home</span></HashLink>
            </div>

            <div className="nav-item">
            <HashLink smooth to="#about" className="nav-link"><span className="nav-label" id="nav-label">About</span></HashLink>
            </div>

            <div className="nav-item">
            <HashLink smooth to="#projects" className="nav-link"> <span className="nav-label" id="nav-label">Projects</span></HashLink>
            </div>

            <div className="nav-item">
            <HashLink smooth to="#blog" className="nav-link"> <span className="nav-label" id="nav-label">Blog</span></HashLink>
            </div>

            <div className="nav-item">
            <HashLink smooth to="#contact" className="nav-link"> <span className="nav-label" id="nav-label">Contact</span></HashLink>
            </div>

    </nav>);
};
